const initialState = {
    todoList : [{
        id: 1,
        name: 'todo1',
        isCheck: false
    },{
        id: 2,
        name: 'todo2',
        isCheck: false
    }
    ],
    status:'ALL'
}
const todosReducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state
    }
}
export default todosReducer
